    false,nt"url": null,nt"notes": "The purpose of acquiring the Buena Vista
    property is to enhance survival prospects of  endangered species in the area and
    provide opportunities for compatible wildlife-dependent  recreational activities
    in partnership with the local community and interested groups and  individuals.
    This expansion is being proposed primarily to protect the endangered Santa Cruz
     long-toed salamander (Ambystoma macrodactylum croceum). In addition, acquisition
    of this site  would benefit other rare species including the endangered robust spineflower
    (Chorizanthe  robusta var. robusta) and the threatened California tiger salamander
    (Ambystoma californiense).  Buena Vista supports one of only six known populations
    of the robust spineflower, and 135 acres  of the property are included in the designated
    critical habitat (50 CFR 17 36822-36845). Other  rare plants on the site include
    Hookeru2019s manzanita (Arctostaphylos hookeri ssp. hookeri) (CNPS  1B), Kelloggu2019s
    horkelia (Horkelia cuneata ssp. sericea) (CNPS 1B), and California bottlebrush  grass
    (Elymus californicus) (CNPS 4).",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
